const handleClick = () => {
  navigate(-1);
}; 
  return (
    <div style={{background:'#0064804d',width:'50%',marginLeft:'20%',marginTop:'5%'}}>
      <Button variant="info" onClick={handleClick} style={{ margin: "10px" }}>
        Home
      </Button>
